text:
@gadgetlover8 κοινός βλάκας, έτρεξε να συκοφαντήσει τις ηπα ενώ δεν καταργήθηκαν νομικά οι αμβλώσεις.

κοινό κλεφτρόνι, με τα 100στάρικα που αρπάζει μέσω νομιμοφανούς εκβιασμού των γηραιών ελλήνων.

κάποιος να πεί στην ντόρα να τραβήξει επιτέλους τ'αυτί του άτακτου παιδιού της.

μήπως θα ήταν μια λύση για το δημογραφικό πρόβλημα της ευρώπης , η οποια "γερνάει" ;

είναι πιθανόν το "μπολιασμα" του πληθυσμού με τα ανεπιθύμητα παιδιά, να αυξήσει την παραγωγικότητα και να εξυγιάνει τα ασφαλιστικά ταμεία;

#αμβλωσεις 
#cancel_εκτρωσεις

@koulermouniki ερώτηση: θέλω να δω πού τοποθετείστε για τις σχέσεις κράτους-εκκλησία
απάντηση: δεν υπάρχει τέτοιο ερώτημα
ερώτηση: ευθανασία, αμβλώσεις και πολιτική κηδεία, κάτι που διαφωνεί η εκκλησία;
απάντηση: η πολιτεία επιτρέπει τις αμβλώσεις υπό προϋποθέσεις - να συμπεριληφθούν στο γεσυ

@primeministergr πρόεδρε, η κ. αλεξοπούλου @xrisalex, βουλευτής του κόμματος @neademokratia, διαφωνεί μαζί σου και έχει το σθένος να το φωνάζει.
ψυχάρα η χριστίνα, δεν κωλώνει.
